import React, { Component } from "react";

import {
  Col,
  Row,
  Button,
  Form,
  Card,
  FormGroup,
  Label,
  Input,
  FormText,
  InputGroup,
} from "reactstrap";
import InputRange from "react-input-range";
import "react-input-range/lib/css/index.css";
class FilterPage extends Component {
  render() {
    return (
      <div>
        <Form style={{ margin: 10, marginRight: 100, marginTop: 20 }}>
          <Row>
            <Label for="exampleEmail">Name</Label>
            <Input
              type="email"
              name="email"
              id="exampleEmail"
              placeholder="with a placeholder"
            />
          </Row>
          <Row>
            <Col>
              <Label for="exampleEmail">Name</Label>
              <Input
                type="email"
                name="email"
                id="exampleEmail"
                placeholder="with a placeholder"
              />
            </Col>

            <Col style={{ marginLeft: 10 }}>
              <Label for="examplePassword">Height</Label>
              <InputGroup style={{ marginTop: 10 }}>
                <InputRange
                  maxValue={100}
                  minValue={0}
                  formatLabel={(value) => `${value} `}
                  value={40}
                  onChangeComplete={(value) => console.log(value)}
                />
              </InputGroup>
            </Col>
            <Col>
              <Label for="examplePassword">Weight</Label>
              <InputGroup style={{ marginTop: 10 }}>
                <InputRange
                  maxValue={100}
                  minValue={0}
                  formatLabel={(value) => `${value} `}
                  value={40}
                  onChangeComplete={(value) => console.log(value)}
                />
              </InputGroup>
            </Col>
            <Col style={{ marginLeft: 10 }}>
              <Label for="examplePassword">Overall</Label>
              <InputGroup style={{ marginTop: 10 }}>
                <InputRange
                  maxValue={100}
                  minValue={0}
                  formatLabel={(value) => `${value} `}
                  value={40}
                  onChangeComplete={(value) => console.log(value)}
                />
              </InputGroup>
            </Col>
            <Col style={{ marginLeft: 10 }}>
              <Label for="examplePassword">Potential</Label>
              <InputGroup style={{ marginTop: 10 }}>
                <InputRange
                  maxValue={100}
                  minValue={0}
                  formatLabel={(value) => `${value} `}
                  value={40}
                  onChangeComplete={(value) => console.log(value)}
                />
              </InputGroup>
            </Col>
          </Row>
          <Row style={{ marginTop: 100 }}>
            <Col>
              <Label for="exampleSelect">Position</Label>
              <InputGroup style={{ marginTop: 10 }}>
                <Input type="select" name="select" id="exampleSelect">
                  <option>1</option>
                  <option>2</option>
                  <option>3</option>
                  <option>4</option>
                  <option>5</option>
                </Input>
              </InputGroup>
            </Col>
            <Col>
              <Label for="exampleSelect">Nationality</Label>
              <InputGroup style={{ marginTop: 10 }}>
                <Input type="select" name="select" id="exampleSelect">
                  <option>1</option>
                  <option>2</option>
                  <option>3</option>
                  <option>4</option>
                  <option>5</option>
                </Input>
              </InputGroup>
            </Col>
            <Col>
              <Label for="exampleSelect">League</Label>
              <InputGroup style={{ marginTop: 10 }}>
                <Input type="select" name="select" id="exampleSelect">
                  <option>1</option>
                  <option>2</option>
                  <option>3</option>
                  <option>4</option>
                  <option>5</option>
                </Input>
              </InputGroup>
            </Col>
            <Col>
              <Label for="exampleSelect">Team</Label>
              <InputGroup style={{ marginTop: 10 }}>
                <Input type="select" name="select" id="exampleSelect">
                  <option>1</option>
                  <option>2</option>
                  <option>3</option>
                  <option>4</option>
                  <option>5</option>
                </Input>
              </InputGroup>
            </Col>
            <Col>
              <Label for="exampleSelect">Preferred Foot</Label>
              <InputGroup style={{ marginTop: 10 }}>
                <Input
                  type="select"
                  color="yellow"
                  name="select"
                  id="exampleSelect"
                >
                  <option>1</option>
                  <option>2</option>
                  <option>3</option>
                  <option>4</option>
                  <option>5</option>
                </Input>
              </InputGroup>
            </Col>
          </Row>{" "}
          <Row style={{ marginTop: 100 }}>
            <Col style={{ marginLeft: 10 }}>
              <Label for="examplePassword">ACCELERATION</Label>
              <InputGroup style={{ marginTop: 10 }}>
                <InputRange
                  maxValue={100}
                  minValue={0}
                  formatLabel={(value) => `${value} `}
                  value={40}
                  onChangeComplete={(value) => console.log(value)}
                />
              </InputGroup>
            </Col>

            <Col style={{ marginLeft: 10 }}>
              <Label for="examplePassword"> SPRINT SPEED</Label>
              <InputGroup style={{ marginTop: 10 }}>
                <InputRange
                  maxValue={100}
                  minValue={0}
                  formatLabel={(value) => `${value} `}
                  value={40}
                  onChangeComplete={(value) => console.log(value)}
                />
              </InputGroup>
            </Col>
            <Col>
              <Label for="examplePassword">FINISHING</Label>
              <InputGroup style={{ marginTop: 10 }}>
                <InputRange
                  maxValue={100}
                  minValue={0}
                  formatLabel={(value) => `${value} `}
                  value={40}
                  onChangeComplete={(value) => console.log(value)}
                />
              </InputGroup>
            </Col>
            <Col style={{ marginLeft: 10 }}>
              <Label for="examplePassword">LONG SHOTS</Label>
              <InputGroup style={{ marginTop: 10 }}>
                <InputRange
                  maxValue={100}
                  minValue={0}
                  formatLabel={(value) => `${value} `}
                  value={40}
                  onChangeComplete={(value) => console.log(value)}
                />
              </InputGroup>
            </Col>
            <Col style={{ marginLeft: 10 }}>
              <Label for="examplePassword">POSITIONING</Label>
              <InputGroup style={{ marginTop: 10 }}>
                <InputRange
                  maxValue={100}
                  minValue={0}
                  formatLabel={(value) => `${value} `}
                  value={40}
                  onChangeComplete={(value) => console.log(value)}
                />
              </InputGroup>
            </Col>
          </Row>{" "}
          <Row style={{ marginTop: 100 }}>
            <Col style={{ marginLeft: 10 }}>
              <Label for="examplePassword"> SHOT POWER</Label>
              <InputGroup style={{ marginTop: 10 }}>
                <InputRange
                  maxValue={100}
                  minValue={0}
                  formatLabel={(value) => `${value} `}
                  value={40}
                  onChangeComplete={(value) => console.log(value)}
                />
              </InputGroup>
            </Col>

            <Col style={{ marginLeft: 10 }}>
              <Label for="examplePassword">CROSSING</Label>
              <InputGroup style={{ marginTop: 10 }}>
                <InputRange
                  maxValue={100}
                  minValue={0}
                  formatLabel={(value) => `${value} `}
                  value={40}
                  onChangeComplete={(value) => console.log(value)}
                />
              </InputGroup>
            </Col>
            <Col>
              <Label for="examplePassword">LONG PASSING</Label>
              <InputGroup style={{ marginTop: 10 }}>
                <InputRange
                  maxValue={100}
                  minValue={0}
                  formatLabel={(value) => `${value} `}
                  value={40}
                  onChangeComplete={(value) => console.log(value)}
                />
              </InputGroup>
            </Col>
            <Col style={{ marginLeft: 10 }}>
              <Label for="examplePassword">SHORT PASSING</Label>
              <InputGroup style={{ marginTop: 10 }}>
                <InputRange
                  maxValue={100}
                  minValue={0}
                  formatLabel={(value) => `${value} `}
                  value={40}
                  onChangeComplete={(value) => console.log(value)}
                />
              </InputGroup>
            </Col>
            <Col style={{ marginLeft: 10 }}>
              <Label for="examplePassword">VISION</Label>
              <InputGroup style={{ marginTop: 10 }}>
                <InputRange
                  maxValue={100}
                  minValue={0}
                  formatLabel={(value) => `${value} `}
                  value={40}
                  onChangeComplete={(value) => console.log(value)}
                />
              </InputGroup>
            </Col>
          </Row>{" "}
          <Row style={{ marginTop: 100 }}>
            <Col style={{ marginLeft: 10 }}>
              <Label for="examplePassword">AGILITY</Label>
              <InputGroup style={{ marginTop: 10 }}>
                <InputRange
                  maxValue={100}
                  minValue={0}
                  formatLabel={(value) => `${value} `}
                  value={40}
                  onChangeComplete={(value) => console.log(value)}
                />
              </InputGroup>
            </Col>

            <Col style={{ marginLeft: 10 }}>
              <Label for="examplePassword">BALANCE</Label>
              <InputGroup style={{ marginTop: 10 }}>
                <InputRange
                  maxValue={100}
                  minValue={0}
                  formatLabel={(value) => `${value} `}
                  value={40}
                  onChangeComplete={(value) => console.log(value)}
                />
              </InputGroup>
            </Col>
            <Col>
              <Label for="examplePassword">BALL CONTROL</Label>
              <InputGroup style={{ marginTop: 10 }}>
                <InputRange
                  maxValue={100}
                  minValue={0}
                  formatLabel={(value) => `${value} `}
                  value={40}
                  onChangeComplete={(value) => console.log(value)}
                />
              </InputGroup>
            </Col>
            <Col style={{ marginLeft: 10 }}>
              <Label for="examplePassword">DRIBBLING</Label>
              <InputGroup style={{ marginTop: 10 }}>
                <InputRange
                  maxValue={100}
                  minValue={0}
                  formatLabel={(value) => `${value} `}
                  value={40}
                  onChangeComplete={(value) => console.log(value)}
                />
              </InputGroup>
            </Col>
            <Col style={{ marginLeft: 10 }}>
              <Label for="examplePassword">HEADING</Label>
              <InputGroup style={{ marginTop: 10 }}>
                <InputRange
                  maxValue={100}
                  minValue={0}
                  formatLabel={(value) => `${value} `}
                  value={40}
                  onChangeComplete={(value) => console.log(value)}
                />
              </InputGroup>
            </Col>
          </Row>{" "}
          <Row style={{ marginTop: 100 }}>
            <Col style={{ marginLeft: 10 }}>
              <Label for="examplePassword">INTERCEPTIONS</Label>
              <InputGroup style={{ marginTop: 10 }}>
                <InputRange
                  maxValue={100}
                  minValue={0}
                  formatLabel={(value) => `${value} `}
                  value={40}
                  onChangeComplete={(value) => console.log(value)}
                />
              </InputGroup>
            </Col>

            <Col style={{ marginLeft: 10 }}>
              <Label for="examplePassword"> MARKING</Label>
              <InputGroup style={{ marginTop: 10 }}>
                <InputRange
                  maxValue={100}
                  minValue={0}
                  formatLabel={(value) => `${value} `}
                  value={40}
                  onChangeComplete={(value) => console.log(value)}
                />
              </InputGroup>
            </Col>
